import React, { Component } from "react";

export default class Navbar extends Component {
  render() {
    return (
      <div style={{ display: "flex", background: "blue", padding: "0.5" }}>
        <h1>Movies App</h1>
        <h4 style={{ marginleft: "3rem", marginTop: "1rem" }}>Favourites</h4>
      </div>
    );
  }
}
